<head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>Bus Ticket</title>
<style>
    body {
      margin: 0;
      font-family: -apple-system, BlinkMacSystemFont, sans-serif;
      text-align: center;
      background-color: white;
      padding-bottom: 70px; /* prevent footer from overlapping content */
    }
    img {
      max-width: 100%;
      height: auto;
      display: block;
    }
    .time-date {
      font-weight: bold;
      font-size: 24px;
      margin-top: 10px;
    }
    .bar-container {
      width: 90%;
      margin: 10px auto;
      display: flex;
      height: 20px;
    }
    .bar {
      flex: 1;
      transition: opacity 0.5s ease-in-out;
    }
    .pink { background-color: #d8a3ad; }
    .green { background-color: #7fff7f; }
    .blue { background-color: #3d72b4; }
    .expires-text {
      font-weight: bold;
      font-size: 20px;
      margin-bottom: 20px;
    }
    .spacer {
      height: 180px;
    }
    .footer {
      position: fixed;
      bottom: 0;
      left: 0;
      width: 100%;
      z-index: 10;
    }
  </style>
</head>

<script>
    function updateTime() {
      const now = new Date();
      const timeOptions = { hour: '2-digit', minute: '2-digit', second: '2-digit', hour12: true };
      const dateOptions = { weekday: 'long', month: 'short', day: '2-digit' };
      const time = now.toLocaleTimeString('en-US', timeOptions);
      const date = now.toLocaleDateString('en-US', dateOptions) + ', 2025';
      document.getElementById('time').textContent = time;
      document.getElementById('date').textContent = date;
    }

    let visible = true;
    setInterval(() => {
      visible = !visible;
      document.getElementById('bar1').style.opacity = visible ? 1 : 0;
      document.getElementById('bar2').style.opacity = visible ? 1 : 0;
      document.getElementById('bar3').style.opacity = visible ? 1 : 0;
    }, 800);

    let countdownTime = 3600;
    function updateCountdown() {
      const hours = String(Math.floor(countdownTime / 3600)).padStart(2, '0');
      const minutes = String(Math.floor((countdownTime % 3600) / 60)).padStart(2, '0');
      const seconds = String(countdownTime % 60).padStart(2, '0');
      document.getElementById('countdown').textContent = 'Expires in 00:' + hours + ':' + minutes + ':' + seconds;
      if (countdownTime > 0) countdownTime--;
    }

    setInterval(updateTime, 1000);
    setInterval(updateCountdown, 1000);
    updateTime();
    updateCountdown();
  </script>
